import React, { Component } from 'react';
//import { NavLink } from 'react-router-dom';
//import * as router from 'react-router-dom';
import PropTypes from 'prop-types';
import {
  CToggler,
  CHeaderBrand,
  CHeaderNav,
  CHeaderNavItem,
  CHeaderSubheader,
  CBreadcrumb,
  CLink
  } from '@coreui/react';
import {
  CIcon
} from '@coreui/icons-react';

import Config from '../../Common/Config';

// routes config
import routes from '../../../routes';

import DefaultHeaderDropdown  from './DefaultHeaderDropdown'
import logo from '../../../assets/images/logo.png'

// import logo from '../../../assets/coreui/img/brand/coreui-pro-base.svg'
//import sygnet from '../../assets/img/brand/coreui-signet.svg'

const propTypes = {
  children: PropTypes.node,
};

const defaultProps = {};

class DefaultHeader extends Component {
  render() {

    // eslint-disable-next-line
    const {
      toggleSidebarMobile,
      toggleSidebar,
      toggleAside,
      toggleTheme
    } = this.props;

    return (
      <>

        <CToggler
          inHeader
          className="ml-3 d-lg-none"
          toggle={toggleSidebarMobile}
        />
        <CToggler
          inHeader
          className="ml-3 d-md-down-none"
          toggle={toggleSidebar}
        />
        <CLink href="/" target="_blank">
          <CHeaderBrand
            className="mx-auto d-lg-none"
            src={logo}
            width="97"
            height="46"
            alt="CoreUI Logo"
          />
        </CLink>

        <CHeaderNav className="d-md-down-none mr-auto">
          {/* <CHeaderNavItem custom className="px-3" to="/">
            Dashboard
          </CHeaderNavItem> */}
          <CHeaderNavItem to="/"className="px-3">
            Home
          </CHeaderNavItem>
        </CHeaderNav>

        <CHeaderNav>

        </CHeaderNav>

        <CHeaderSubheader className="px-3 justify-content-between">
          <CBreadcrumb className="border-0 c-subheader-nav" appRoutes={routes} />
            {/* <ul className="d-md-down-none mfe-2 c-subheader-nav">
              <li className="c-subheader-nav-link">
                <CLink href="#">
                  <CIcon name="cil-speech" alt="Settings" />
                </CLink>
              </li>
              <li className="c-subheader-nav-link">
                <CLink aria-current="page" href="#/dashboard">
                  <CIcon name="cil-graph" alt="Dashboard" /> Dashboard
                </CLink>
              </li>
              <li className="c-subheader-nav-link">
                <CLink href="#">
                  <CIcon name="cil-settings" alt="Settings" /> Settings
                </CLink>
              </li>
            </ul> */}
          {/* <CHeaderNav className="d-md-down-none mfe-2 c-subheader-nav">
           <CHeaderNavItem className="c-subheader-nav-link">
             <CIcon name="cil-speech" alt="Settings" />
           </CHeaderNavItem>
           <CHeaderNavItem to="/dashboard" className="c-subheader-nav-link">
             <CIcon name="cil-graph" alt="Dashboard" /> Dashboard
           </CHeaderNavItem>
           <CHeaderNavItem className="c-subheader-nav-link">
             <CIcon name="cil-settings" alt="Settings" /> Settings
           </CHeaderNavItem>
          </CHeaderNav> */}
        </CHeaderSubheader>

      </>
    );
  }
}

DefaultHeader.propTypes = propTypes;
DefaultHeader.defaultProps = defaultProps;

export default DefaultHeader;
